    // } 
    const allImg = artpieces.map(item => <div key ={item.id}><img src={item.uri} alt="artpiece" /><p>{item.title}</p></div>);



    return (
        <div>
            <h1> gallery </h1>
            <div className ="canvasImgArray">
                {allImg}
            </div>   
            <button onClick={() => console.log(artpieces)}> console </button>
        </div>

    )
}

export default Gallery
